import{_ as l,c as e,o as i,ah as o}from"./chunks/framework.DaDXF32t.js";const t="/assets/find_config.SbF13gJw.png",_=JSON.parse('{"title":"如何上报bug (How to Report Bugs)","description":"","frontmatter":{},"headers":[],"relativePath":"usage_doc/report.md","filePath":"usage_doc/report.md","lastUpdated":1768030488000}'),r={name:"usage_doc/report.md"};function s(n,a,c,h,d,g){return i(),e("div",null,a[0]||(a[0]=[o('<h1 id="如何上报bug-how-to-report-bugs" tabindex="-1">如何上报bug (How to Report Bugs) <a class="header-anchor" href="#如何上报bug-how-to-report-bugs" aria-label="Permalink to “如何上报bug (How to Report Bugs)”">​</a></h1><h2 id="前言" tabindex="-1">前言 <a class="header-anchor" href="#前言" aria-label="Permalink to “前言”">​</a></h2><p>在提问题之前至少花费5分钟来思考和准备,才会有人花费他的5分钟来帮助你。</p><p>在提问题前, 请先:</p><ol><li>检查<strong>BAAS</strong>的更新，确认使用的是最新版。(<a href="/usage_doc/update.html">如何更新</a>)</li><li>检查模拟器 / 游戏设置 是否为<a href="/usage_doc/config.html#如何使用">推荐配置</a></li><li>这个问题是否以前出现过，我是否能自己尝试解决。 <ul><li><a href="/usage_doc/install/Windows.html#问题解答">常见安装问题</a></li><li><a href="/usage_doc/faq.html">常见使用问题</a></li><li><a href="https://github.com/pur1fying/blue_archive_auto_script/issues" target="_blank" rel="noreferrer">查询github issue是否有同样的解决方法</a></li></ul></li><li>我现在是否每次运行都出现这个问题, 或它的发生是否遵循一定规律。</li><li>我该提供哪些信息来让其他人帮我解决问题。</li><li>在qq群内发色图或许更能吸引他人帮你解决问题。</li></ol><div class="info custom-block"><p class="custom-block-title custom-block-title-default">INFO</p><p>上报问题前务必准备好完整日志与相关截图</p><p>我们也推荐你直接录制完整视频, 注意视频应该让模拟器和<strong>BAAS</strong>同框.</p></div><h2 id="常见问题类型与对应汇报内容" tabindex="-1">常见问题类型与对应汇报内容 <a class="header-anchor" href="#常见问题类型与对应汇报内容" aria-label="Permalink to “常见问题类型与对应汇报内容”">​</a></h2><h3 id="_1-我卡在xxx页面不动了" tabindex="-1">1.我卡在XXX页面不动了!： <a class="header-anchor" href="#_1-我卡在xxx页面不动了" aria-label="Permalink to “1.我卡在XXX页面不动了!：”">​</a></h3><ol><li>卡住时1280x720游戏画面(MuMu按F9截图), 注意在qq发图时应发送<strong>png</strong>格式图像</li><li><strong>Baas</strong>日志截图</li><li>尝试切换页面,看一下是否只会卡在这个页面</li></ol><h3 id="_2-我推图走格子卡住不动了" tabindex="-1">2.我推图走格子卡住不动了!： <a class="header-anchor" href="#_2-我推图走格子卡住不动了" aria-label="Permalink to “2.我推图走格子卡住不动了!：”">​</a></h3><ol><li>尝试重新推1-2次观察是否每次都是卡在一个位置。 如果仍卡在同一位置:</li><li>录制完整从点击&quot;开始推图&quot;到卡住时视频，注意模拟器游戏界面和Baas日志界面同屏录制。</li></ol><h3 id="_3-我设置了xxx配置但是没有打-我没设置xxx但是打了" tabindex="-1">3.我设置了XXX配置但是没有打! / 我没设置XXX但是打了!： <a class="header-anchor" href="#_3-我设置了xxx配置但是没有打-我没设置xxx但是打了" aria-label="Permalink to “3.我设置了XXX配置但是没有打! / 我没设置XXX但是打了!：”">​</a></h3><ol><li>仔细阅读配置说明，查看是否正确理解该怎么填写。</li><li>配置截图与程序日志截图。</li></ol><h2 id="如何查询对应配置文件" tabindex="-1">如何查询对应配置文件 <a class="header-anchor" href="#如何查询对应配置文件" aria-label="Permalink to “如何查询对应配置文件”">​</a></h2><ol><li><strong>BAAS</strong>配置文件存放在config目录下, config目录下每一个文件夹对应一个配置</li><li>打开文件夹, 找到config.json文件, 用文本编辑器打开, name的值与GUI显示的名称对应</li></ol><ul><li><img src="'+t+'" alt="find_config.png"></li></ul>',16)]))}const p=l(r,[["render",s]]);export{_ as __pageData,p as default};
